let driver = await new Builder()
.forBrowser('firefox')
.build()

//keep the window open
await driver
.getWindowHandle()

//open the website 
await driver
.get('https://lambdatest.github.io/sample-todo-app')

//find the element and type 'Learn Selenium', then press ENTER
await driver
.findElement(By.id('sampletodotext'))
.sendKeys('Learn Mocha', Key.RETURN)
//Find the last li element and get its value
let todoText = await driver
.findElement(By.xpath("//li[last()]"))
.getText()
.then(function(value){
    return value
})

//check if the selected li value equals
todoText.should.equal('Learn Mocha')
//close the browser window
await driver.quit()

